import Navbar from "./Navbar";
import Head from "next/head";
import styled from "styled-components";

const Button = styled.button``;

const Layout = props => (
  <div>
    <Head>
      <title>Developers Today</title>
    </Head>
    <Navbar />
    <Button>Button</Button>
    {props.children}
  </div>
);

export default Layout;
